reviews:
1) Nice curtains near the bed + sockets and USB-things for charging your phone;
2) A bit of scary neighborhood, so it was kind of dangerous to go home in evening (I was staying alone);
3) Four toilets and showers per floor. Shower turns off when you do not push on/off buttons that was strange;
4) A bit of noisy, you hear people from outside, because there is a train station nearby;
5) I stayed there 4 nights and it was generally a pleasant experience!
